const sideKey = "HONGKONGBLOCKCHAINSOCIETY"
var firstRoot = null
var newestRoot = null

let mamState = Mam.init(null)
// Set channel mode
mamState = Mam.changeMode(
    mamState,
    'restricted',
    sideKey
)

LiquidCore.emit('console',{content: "initialised"})

// Publish to tangle
function publish ( packet ) {

    // Create MAM Payload - STRING OF TRYTES
    const message = Mam.create(mamState, packet)
    // Save new mamState
    mamState = message.state

    // console.log('Root: ', message.root)

    if (firstRoot === null){
        firstRoot = message.root
    }
    newestRoot = message.root

	return message
}

